import React from "react";

const TodoList = () => {
  return (
    <>
      <div className="main_div">
        <div className="center_div">
          <br />
          <h1>TodoList</h1>
          <br />
          <input type="text" placeholder="Add items in Todo" />
         
        </div>
      </div>
    </>
  );
};

export default TodoList;
